import Item from "./Item";

const List = ({ listData }) => {
  return (
    <div className="list">
      {listData.map((eachItemInListData) => {
        const { note, date, time } = eachItemInListData;
        return <Item noteToItem={note} dateToItem={date} timeToItem={time} />;
      })}
    </div>
  );
};

export default List;
